import React, {Component} from 'react';
import { Card, CardImg, CardImgOverlay, CardText, CardBody,CardTitle } from 'reactstrap';
class DishDetail extends Component{
    render()
    {
        rendercomments(comments)
        {
            if (comments != null)
            return(
                <div>
                <li>{comments.description}</li>
                <li>{comments.author} &nbsp; {comments.date}</li>
                </div>
            );
        else
            return(
                <div></div>
            );
        }
        
        return (
           <div className="row"> 
          <div  className="col-12 col-md-5 m-1">
          <Card key={this.props.dishes.id}
            >
            <CardImg width="100%" src={this.props.dishes.image} alt={this.props.dishes.name} />
            <CardTitle>{this.props.dishes.name}</CardTitle>
            <CardText>{this.props.dishes.description}
            </CardText>
          </Card>
        </div>
        <div className="col-12 col-md-5 m-1">
            <h4>Comments</h4>
            <ul className="list-unstyled">
            {rendercomments(this.props.comments)}
            </ul>
        </div>
        </div>

        );
    }
}
export default DishDetail;
